import React from 'react';

const Enemy = ({ position }) => {
  const style = {
    position: 'absolute',
    width: '50px',
    height: '50px',
    backgroundColor: 'red',  // 敌人为红色
    left: position[0],
    top: position[1],
  };

  return <div style={style}></div>;
};

export default Enemy;
